css:
.react-tabs {
  flex: 1;
  display: flex;
  flex-direction: column;
}
.react-tabs__tab-panel--selected {
  flex: 1;
  overflow: auto;
}
.github-tab {
  padding: 5px 15px;
  text-align: center;
  font-weight: 600;
  color: #62677f;
  cursor: default;
  user-select: none;
}
.github-tablist {
  flex: none;
  display: flex;
  justify-content: center;
  padding: 0;
  margin: 0;
  list-style: none;
  border-bottom: 1px solid #21222c;
  background-color: #21222c;
}
.github-tab-icon {
  color: #3d4051;
  vertical-align: middle;
}
.github-tab-icon:before {
  margin-right: .4em;
}
.github-tab-count {
  display: inline-block;
  background-color: rgba(41, 43, 55, 0.92);
  border-radius: 3px;
  padding: 0 .25em;
  margin-left: 5px;
}
.github-tab.react-tabs__tab--selected {
  color: #f8f8f2;
  box-shadow: 0 1px 0 #ff7ac6;
}
.github-tab.react-tabs__tab--selected .github-tab-icon {
  color: #787d9b;
}
